import React from "react";

const NewsLetter = () => {
  return (
    <div className="newsletter">
      <form>
        <div>
          <label>Firstname</label>
          <input type="text" />
        </div>
        <div>
          <label>Lastname</label>
          <input type="text" />
        </div>
        <div>
          <label>Email</label>
          <input type="text" />
        </div>
        <button type="submit">Recieve Gift!</button>
      </form>
    </div>
  );
};

export default NewsLetter;
